<!DOCTYPE html>
<html lang="fa" dir="rtl">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>سبد خرید</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: Arial, sans-serif;
            min-height: 100vh;
            background: linear-gradient(180deg, #A6ACD0 16.21%, #7E7A94 50%, #57546A 80.47%);
        }

        .container {
            max-width: 375px;
            margin: 0 auto;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
        }

        /* Header */
        header {
            background: #FFFFFF;
            height: 69px;
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 0 16px;
            position: relative;
            flex-shrink: 0;
        }

        .cart-icon-wrapper {
            position: relative;
            width: 38px;
            height: 38px;
            display: flex;
            align-items: center;
            justify-content: center;
            background: #FE7F00;
            border-radius: 50%;
        }

        .cart-icon {
            width: 20px;
            height: 20px;
            color: #F0F0F0;
        }

        .badge {
            position: absolute;
            top: -4px;
            right: -4px;
            width: 18px;
            height: 18px;
            background: #FF3030;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 10px;
            font-weight: bold;
            color: white;
        }

        .nav-menu {
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
            display: flex;
            gap: 16px;
            font-size: 12px;
            white-space: nowrap;
            flex-direction: row;
        }

        .nav-menu a {
            text-decoration: none;
            background: none;
            border: none;
            color: #000;
            cursor: pointer;
            transition: color 0.3s;
            white-space: nowrap;
        }

        .nav-menu a:hover {
            color: #666;
        }

        .nav-menu .active {
            font-weight: bold;
            color: #1B1747;
            font-size: 13px;
            white-space: nowrap;
        }

        .user-icon {
            width: 38px;
            height: 38px;
            display: flex;
            align-items: center;
            justify-content: center;
            background: #1B1747;
            border-radius: 50%;
        }

        .user-icon svg {
            width: 20px;
            height: 20px;
            color: #F0F0F0;
        }

        /* Cart Items */
        .cart-items {
            padding: 24px 16px;
            display: flex;
            flex-direction: column;
            gap: 16px;
            flex: 1;
        }

        .cart-item {
            background: #F8F7F7;
            border-radius: 10px;
            padding: 12px;
            display: flex;
            gap: 12px;
            position: relative;
            min-height: 110px;
        }

        .product-image {
            width: 126px;
            height: 99px;
            border-radius: 10px;
            object-fit: cover;
            flex-shrink: 0;
        }

        .product-details {
            flex: 1;
            display: flex;
            flex-direction: column;
        }

        .product-name {
            font-weight: bold;
            font-size: 14px;
            color: #000;
            margin-bottom: 8px;
        }

        .product-weight {
            font-size: 12px;
            color: #9B9999;
            font-weight: 600;
            margin-bottom: 8px;
        }

        .product-price {
            font-size: 12px;
            color: #6055D8;
            font-weight: 600;
        }

        .remove-btn {
            position: absolute;
            top: 12px;
            left: 12px;
            width: 24px;
            height: 24px;
            background: none;
            border: none;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 50%;
            transition: background 0.3s;
        }

        .remove-btn:hover {
            background: rgba(247, 90, 90, 0.1);
        }

        .remove-btn svg {
            width: 20px;
            height: 20px;
            color: rgba(247, 90, 90, 0.7);
        }

        .quantity-controls {
            position: absolute;
            bottom: 12px;
            left: 12px;
            display: flex;
            align-items: center;
            gap: 12px;
        }

        .quantity-btn {
            width: 28px;
            height: 28px;
            border-radius: 50%;
            background: rgba(96, 85, 216, 0.81);
            border: none;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: background 0.3s;
        }

        .quantity-btn:hover {
            background: #6055D8;
        }

        .quantity-btn svg {
            width: 14px;
            height: 14px;
            color: white;
        }

        .quantity {
            font-size: 16px;
            font-weight: 500;
            color: rgba(0, 0, 0, 0.7);
            min-width: 20px;
            text-align: center;
        }

        /* Order Summary */
        .order-summary {
            background: #F8F7F7;
            border-radius: 10px;
            padding: 16px;
        }

        .summary-title {
            font-weight: bold;
            font-size: 16px;
            color: #000;
            margin-bottom: 16px;
        }

        .summary-row {
            display: flex;
            justify-content: space-between;
            font-size: 14px;
            color: #484848;
            margin-bottom: 12px;
        }

        .summary-total {
            border-top: 1px solid #A9A6A6;
            padding-top: 12px;
            display: flex;
            justify-content: space-between;
            font-size: 14px;
            font-weight: 500;
            color: #000;
        }

        /* Checkout Button */
        .checkout-section {
            padding: 0 16px;
            margin-top: 4px;
            margin-bottom: 24px;
            flex-shrink: 0;
        }

        .checkout-btn {
            width: 100%;
            height: 48px;
            background: #6055D8;
            border-radius: 30px;
            border: none;
            color: white;
            font-weight: bold;
            font-size: 18px;
            cursor: pointer;
            transition: background 0.3s;
            box-shadow: 1 1px 1px #ffffffe3;
            outline: 2px solid #FFFFFF; /* اضافه کردن این خط */
        }

        .checkout-btn:hover {
            background: #5048c0;
        }

        /* New Footer Styles */
        .new-footer {
            background: #FFFFFF;
            height: 122px;
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 0 16px;
            position: relative;
            flex-shrink: 0;
        }

        .footer-group {
            position: absolute;
            width: 328px;
            height: 63px;
            left: 21px;
            top: 55px;
        }

        .footer-text-1 {
            position: absolute;
            width: 108px;
            height: 13px;
            left: -12px;
            top: 16px;
            font-family: 'Digi Sarvenaz';
            font-style: normal;
            font-weight: 700;
            font-size: 14px;
            line-height: 146.56%;
            text-align: center;
            color: #000000;
        }

        .footer-text-2 {
            position: absolute;
            width: 110px;
            height: 20px;
            left: 220px;
            top: 16px;
            font-family: 'Digi Sarvenaz';
            font-style: normal;
            font-weight: 700;
            font-size: 14px;
            line-height: 146.56%;
            text-align: center;
            color: #000000;
        }

        .footer-text-3 {
            position: absolute;
            width: 130px;
            height: 63px;
            left: 95px;
            top: 4px;
            font-family: 'Digi Sarvenaz';
            font-style: normal;
            font-weight: 700;
            font-size: 14px;
            line-height: 146.56%;
            text-align: center;
            color: #000000;
        }

        .footer-group-icons {
            position: absolute;
            width: 288px;
            height: 53px;
            left: 37px;
            top: -8px;
        }

        function updateQuantity(id, change) {
            const item = cartItems.find(item => item.id === id);
            if (item) {
                item.quantity = Math.max(1, item.quantity + change);
                renderCart();
            }
        }

        function removeItem(id) {
            cartItems = cartItems.filter(item => item.id !== id);
            renderCart();
        }

        function renderCart() {
            const container = document.getElementById('cartItems');
            const subtotal = cartItems.reduce((sum, item) => sum + item.price * item.quantity, 0);
            const discount = 100;
            const total = subtotal - discount;
            const itemCount = cartItems.length;

            container.innerHTML = cartItems.map(item => `
                <div class="cart-item">
                    <img src="${item.image}" alt="${item.name}" class="product-image">
                    <div class="product-details">
                        <div class="product-name">${item.name}</div>
                        <div class="product-weight">${item.weight}</div>
                        <div class="product-price">$${item.price}</div>
                    </div>
                    <button class="remove-btn" onclick="removeItem(${item.id})">
                        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M6 18L18 6M6 6l12 12" />
                        </svg>
                    </button>
                    <div class="quantity-controls">
                        <button class="quantity-btn" onclick="updateQuantity(${item.id}, -1)">
                            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="3" d="M20 12H4" />
                            </svg>
                        </button>
                        <span class="quantity">${String(item.quantity).padStart(2, '0')}</span>
                        <button class="quantity-btn" onclick="updateQuantity(${item.id}, 1)">
                            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="3" d="M12 4v16m8-8H4" />
                            </svg>
                        </button>
                    </div>
                </div>
            `).join('') + `
                <div class="order-summary">
                    <div class="summary-title">خلاصه سفارشات</div>
                    <div class="summary-row">
                        <span>آیتم ها</span>
                        <span>${itemCount}</span>
                    </div>
                    <div class="summary-row">
                        <span>مجموع قیمت کالاها</span>
                        <span>$${subtotal}</span>
                    </div>
                    <div class="summary-row">
                        <span>تخفیف</span>
                        <span>$${discount}</span>
                    </div>
                    <div class="summary-total">
                        <span>Total</span>
                        <span>$${total}</span>
                    </div>
                </div>
            `;
        }

        function checkout() {
            alert('سفارش شما با موفقیت ثبت شد!');
        }

        renderCart();
    </script>
</body>
</html>
